import React, { useEffect, useState } from 'react';
import '../../index.css';

interface User {
  name: string;
  // Define other properties of user here if needed
}

const Login: React.FC = () => {
  const url = "/users";
  const [users, setUsers] = useState<User[]>([]);

  useEffect(() => {
    fetch(url, { method: "GET" })
      .then((res) => res.json())
      .then((data: User[]) => {
        setUsers(data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div className="App">
      <h1 className="bd-black">Users</h1>
      <ul>
        {users.map((user: User, index: number) => (
          <li key={index}>{user.name}</li>
        ))}
      </ul>
      <div className="border border-gray-400 rounded-2xl p-2 m-2 flex justify-around items-center">
        <h1 className="text-3xl font-bold underline">
          Hello Tailwind CSS!
        </h1>
        <p className="m-0 text-gray-400">Tailwind CSSです</p>
        <button className="bg-gray-300 border-0 p-2 rounded-md hover:bg-gray-400 hover:text-white">ボタン</button>
      </div>
    </div>
  );
}

export default Login;
